import React from 'react';
import Android from '..assets/images/appdev/img_android.png';
import Ios from '..assets/images/appdev/img_ios.png';
import Reactnative from '..assets/images/appdev/img_reactnative.png';
import Flutter from '..assets/images/appdev/img_flutter.png'

export const AppList = [
    {   
        id:"1",
        name:"Android",
        source:Android,
        url:"https://developer.android.com/",
    },
    {   
        id:"2",
        name:"IOS",
        source:Ios,
        url:"https://developer.apple.com/",
    },
    {   
        id:"3",
        name:"React Native",
        source:Reactnative,
        url:"https://reactnative.dev/",
    },
    {   
        id:"4",
        name:"Flutter",
        source:Flutter,
        url:"https://flutter.dev/",
    },
]
